import Vue from 'vue'
import './jssdk/index'
import App from './App.vue'
import router from './router'
import config from './config'
import store from './store/index'
import sdkService from './service/sdkService'
import * as filters from './filter'
import authGuard from '@/service/auth-guard'
import {
  isShare,
  getSystemInfo,
  getParamsFromUrl
} from './utils/index'
import httpService from './service/httpService'

// 添加全局过滤器
Object.keys(filters).forEach(key => {
  Vue.filter(key, filters[key])
})
Vue.config.productionTip = false

getSystemInfo() // 获取系统信息
// 获取签名信息并储存
httpService.get('/front/get-wechat-config').then(res => {
  store.commit('system/updateWxSignature', {
    app_id: res.data.config.app_id,
    jsapi_ticket: res.data.ticket.ticket
  })
})
// 设置URL为签名
window.url = location.href

// 路由守卫
router.beforeEach((to, from, next) => {
  authGuard(to, from, next)
  // 把需要缓存的路由放到数组中
  if (
    to.meta.keepAlive &&
    to.name &&
    !store.state.system.router.includes(to.name)
  ) {
    store.commit('system/updateRouter', {
      type: 'add',
      data: to.name
    })
  }
  //   authGuard(to, from, next)
  // 路由发生变化修改页面title
  if (to.meta.title) {
    document.title = to.meta.title
  }
  next()
})

// 配置微信分享相关内容
router.afterEach((to, from) => {
  setTimeout(() => {
    let reg = new RegExp(to.fullPath.replace(/\?/, '\\?') + '$')
    if (!reg.test(location.href)) return
    if (store.state.system.platform !== 'wechat') return
    if (config.payPath.includes(to.path)) {
      // 支付配置
      sdkService.config('pay')
    } else if (isShare(to.path)) {
      if (getParamsFromUrl('task') || to.path === '/circle/match') {
        sdkService.config('shareTask')
      } else {
        sdkService.config('share')
      }
    } else {
      sdkService.config()
      // 默认分享
      sdkService.defaultShare()
    }
  }, 200)
})

new Vue({
  store,
  router,
  render: h => h(App)
}).$mount('#app')
